    Lacs National Wildlife Refuge is to outline the principal practices and procedures
    necessary to establish a reasonable balance between land use and the refuges primary
    objective--the production and preservation of waterfowl and other beneficial species
    of wildlife.This plan contains information on obtaining a desirable balance between
    economic use and wildlife by means of grazing, haying, farming to create productive
